	 (597,'LADM_COL_V3_0.LADM_Nucleo.COL_EstructuraTipo',NULL,3,'Topologico',NULL,0,'Topológico',NULL);INSERT INTO test_ladm_col_queries.col_fuenteadministrativatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (364,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL,0,'Documento_Publico',NULL,0,'Documento público','Documento público es el otorgado por el funcionario público en ejercicio de sus funciones o con su intervención. Así mismo, es público el documento otorgado por un particular en ejercicio de funciones públicas o con su intervención. Cuando consiste en un escrito autorizado o suscrito por el respectivo funcionario, es instrumento público; cuando es autorizado por un notario o quien haga sus veces y ha sido incorporado en el respectivo protocolo, se denomina escritura pública.'),
	 (365,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',NULL,1,'Documento_Privado',NULL,0,'Documento privado','El documento privado es aquel documento que no cumple los requisitos del documento público, es decir, es un documento que no ha sido elaborado por un funcionario público, ni ha habido intervención de éste para su elaboración.'),
	 (547,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',0,'Documento_Publico.Escritura_Publica',NULL,0,'(Documento público) Escritura pública','Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó'),
	 (548,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',1,'Documento_Publico.Sentencia_Judicial',NULL,0,'(Documento público) Sentencia judicial','La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo'),
	 (549,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',2,'Documento_Publico.Acto_Administrativo',NULL,0,'(Documento público) Acto administrativo','Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.'),
	 (550,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',3,'Documento_Privado.Documento_Privado',NULL,0,'(Documento privado) Documento privado','Documento que contiene un compromiso entre dos o más personas que lo firman.'),
	 (551,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FuenteAdministrativaTipo','LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativaTipo',4,'Documento_Privado.Sin_Documento',NULL,0,'(Documento privado) Sin documento','Cuando no se haya documento soporte pero puede ser una declaración verbal.');INSERT INTO test_ladm_col_queries.col_fuenteespacialtipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (126,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,0,'Croquis_Campo',NULL,0,'Croquis de campo','Ilustración análoga del levantamiento catastral de un predio.'),
	 (127,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,1,'Datos_Crudos',NULL,0,'Datos crudos (GPS, Estación total, LiDAR, etc.)','Datos tomados por un equipo GNSS sin ningún tipo de postprocesamiento.'),
	 (128,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,2,'Ortofoto',NULL,0,'Ortofoto','Imagen producto de la toma de fotografías aéreas o satélites, en la cual han sido corregidos los desplazamientos causados por la inclinación de la cámara o sensor y la curvatura de la superficie del terreno. Está referida a un sistema de proyección cartográfica, por lo que posee las características geométricas de un mapa con el factor adicional de que los objetos se encuentran representados de forma real en la imagen de la fotográfica.'),
	 (129,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,3,'Informe_Tecnico',NULL,0,'Informe técnico','Informe técnico de levantamiento catastral de un predio.'),
	 (130,'LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacialTipo',NULL,4,'Registro_Fotografico',NULL,0,'Registro fotográfico','Registro fotográfico del levantamiento catastral de un predio.');INSERT INTO test_ladm_col_queries.col_grupointeresadotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
