INSERT INTO test_ladm_col_queries.col_unidadadministrativabasicatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (329,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',1,'Predio.Publico.Fiscal',NULL,0,'(Predio) (Público) Fiscal','Los bienes de la Unión cuyo uso no pertenece generalmente a los habitantes, se llaman bienes de la Unión o bienes fiscales'),
	 (330,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',2,'Predio.Publico.Patrimonial',NULL,0,'(Predio) (Público) Patrimonial','Son bienes patrimoniales los de titularidad de las administraciones públicas que no tengan el carácter de bienes de dominio público, es decir, que no estén destinados directamente al uso público o afectados a un servicio público. Si no consta la afectación de un bien se presume su carácter patrimonial.'),
	 (331,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',3,'Predio.Publico.Uso_Publico',NULL,0,'(Predio) (Público) Uso público','Son aquellos inmuebles de dominio público cuyo uso pertenece a todos los habitantes del territorio nacional, destinados al uso o disfrute colectivo.'),
	 (332,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',4,'Predio.Privado',NULL,0,'(Predio) (Privado)','Es aquel que ha salido del patrimonio del estado, cuenta con un propietario inscrito en el folio de matrícula y se considera propiedad privada en los términos del artículo 48 de la Ley 160 de 1993.'),
	 (333,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',5,'Predio.Territorio_Colectivo',NULL,0,'(Predio) (Territorio colectivo)','Son los predios adjudicados a comunidades pertenecientes a grupos étnicos en el marco del reconocimiento de los resguardos legalmente constituidos según el Decreto 2164 de 1995 o de las propiedades colectivas de comunidades negras conforme Ley 70 de 1993.'),
	 (334,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',6,'Predio.Vacante',NULL,0,'(Predio) (Vacante)','Son bienes inmuebles que se encuentran dentro de territorio respectivo a cargo de la Nación, sin dueño aparente o conocido'),
	 (335,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',7,'Ordenamiento_Territorial',NULL,0,'Ordenamiento territorial','Unidad administrativa básica de la temática de ordenamiento territorial.'),
	 (336,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PredioTipo','LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasicaTipo',8,'Servicios_Publicos',NULL,0,'Servicios públicos','Unidad administrativa básica de la temática de servicios públicos.'),
