	 (447,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,62,'Estadios_Coliseos.Tipo_40',NULL,0,'(Estadios o coliseos) Tipo 40','Coliseo, incluye cerramiento en malla, o en bloque pañetado cancha multifuncional, cubierta en teja termo acústica'),
	 (448,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,63,'Plazas_de_Toros.Tipo_80',NULL,0,'(Plaza de toros) Tipo 80','Plaza de toros con estructura en concreto y madera capacidad de más de 10000 espectadores'),
	 (449,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,64,'Plazas_de_Toros.Tipo_20',NULL,0,'(Plaza de toros) Tipo 20','Plaza de toros para corralejas, estructura en madera capacidad menor a 4000 estructura en concreto y madera capacidad'),
	 (450,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,65,'Via_Ferrea.Tipo_80',NULL,0,'(Anexo) (Vía férrea) Tipo 80','Via férrea de trocha  normal o estándar (4 pies, 8 1/2 pulgadas o 1435 metros) con capacidad de transporte mayor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.'),
	 (451,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,66,'Via_Ferrea.Tipo_60',NULL,0,'(Anexo) (Vía férrea) Tipo 60','Via férrea de trocha angosta o yardica de 0.915 metros con capacidad menor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.'),
	 (452,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,67,'Carreteras.Tipo_60',NULL,0,'(Anexo) (Carreteras) Tipo 60','Carretera pavimentada. Compuesta de una subbase granular, base en suelo cemento y carpeta asfáltica, entiéndase por sub-base granular como la capa de material granular situada entre la base del firme y la explanada.'),
	 (453,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,68,'Carreteras.Tipo_40',NULL,0,'(Anexo) (Carreteras) Tipo 40','Carretera sin pavimento. Compuesta de una sub-base granular, entiéndase por su-base granular como la capa de material granular situada entre la base del firme y la explanada.'),
	 (454,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,69,'Cimientos_Estructura_Muros_Placabase.Tipo_80',NULL,0,'(Anexo) (Cimientos estructura muros placabase) Tipo 80','Cimientos y estructura soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros y placas base. Esta tipología se caracteriza por presentar de manera simultánea los 4 elementos (Cimientos, Estructura, Muro o Pared y Losa de Contra piso)');
INSERT INTO test_ladm_col_queries.lc_anexotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (455,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,70,'Cimientos_Estructura_Muros_Placabase.Tipo_60',NULL,0,'(Anexo) (Cimientos estructura muros placabase) Tipo 60','Cimentación y estructura con soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 3 elementos (Cimientos, Estructura, y alguno de estos dos elementos Muro Pared o Losa en Contra piso)'),
	 (456,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,71,'Cimientos_Estructura_Muros_Placabase.Tipo_40',NULL,0,'(Anexo) (Cimientos estructura muros placabase) Tipo 40','Cimentación sin estructura destinada a sostener la totalidad o parte de una futura construcción o edificación, pueden estar acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 2 elementos (Cimientos y alguno de estos dos elemetnos Muro - Pared o Losa de Contra piso)'),
	 (457,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,72,'Cimientos_Estructura_Muros_Placabase.Tipo_20',NULL,0,'(Anexo) (Cimientos estructura muros placabase) Tipo 20','Cimentación sin estructura, destinada a sostener la totalidad o parte de una futura construcción o edificación. Esta tipología se caracteriza por presentar un solo elemento, la cimentación.'),
	 (458,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_AnexoTipo',NULL,73,'Lagunas_de_Oxidacion.Tipo_20',NULL,0,'(Anexo) (Lagunas de oxidación) Tipo 20','Lagunas de oxidación que en su construcción requieren excavaciones en la estructura de la laguna, con o sin protección del área de la laguna con geotextil o geomembrana, construcción de diques, protección de los taludes con geotextil o geomembrana y enrocado de taludes.');INSERT INTO test_ladm_col_queries.lc_calificartipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (540,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CalificarTipo',NULL,0,'Residencial',NULL,0,'Residencial','Calificación para predios de uso residencial.'),
	 (541,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CalificarTipo',NULL,1,'Industrial',NULL,0,'Industrial','Calificación para predios de uso industrial.'),
	 (542,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CalificarTipo',NULL,2,'Institucional',NULL,0,'Institucional','Calificación para predios de uso Institucional.'),
	 (543,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CalificarTipo',NULL,3,'Comercial',NULL,0,'Comercial','Calificación para predios de uso comercial.');INSERT INTO test_ladm_col_queries.lc_categoriasuelotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (503,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CategoriaSueloTipo',NULL,0,'Suburbano',NULL,0,'Suburbano','Constituyen esta categoría las áreas ubicadas dentro del suelo rural, en las que se mezclan los usos del suelo y las formas de vida del campo y la ciudad, diferentes a las clasificadas como áreas de expansión urbana, que pueden ser objeto de desarrollo con restricciones de uso, de intensidad y de densidad, garantizando el autoabastecimiento en servicios públicos domiciliarios, de conformidad con lo establecido en la Ley 99 de 1993 y en la Ley 142 de 1994. Podrán formar parte de esta categoría los suelos correspondientes a los corredores urbanos interregionales.

Los municipios y distritos deberán establecer las regulaciones complementarias tendientes a impedir el desarrollo de actividades y usos urbanos en estas áreas, sin que previamente se surta el proceso de incorporación al suelo urbano, para lo cual deberán contar con la infraestructura de espacio público, de infraestructura vial y redes de energía, acueducto y alcantarillado requerida para este tipo de suelo. (Artículo 34, Ley 388 de 1997)'),
	 (504,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CategoriaSueloTipo',NULL,1,'Proteccion',NULL,0,'Protección','Constituido por las zonas y áreas de terrenos localizados dentro de cualquiera de las anteriores clases, que por sus características geográficas, paisajísticas o ambientales, o por formar parte de las zonas de utilidad pública para la ubicación de infraestructuras para la provisión de servicios públicos domiciliarios o de las áreas de amenazas y riesgo no mitigable para la localización de asentamientos humanos, tiene restringida la posibilidad de urbanizarse. (Articulo 35, Ley 388 de 1997)');INSERT INTO test_ladm_col_queries.lc_clasecalificaciontipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (481,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,0,'Estructura',NULL,0,'Estructura','En construcción, es el nombre que recibe el conjunto de elementos, unidos, ensamblados o conectados entre sí, que tienen la función de recibir cargas, soportar esfuerzos y transmitir esas cargas al suelo, garantizando así la función estático - resistente de la construcción. Sus componentes son: armazón, muros y cubierta.'),
	 (482,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,1,'Acabados_Principales',NULL,0,'Acabados principales','Son los revestimientos o recubrimientos a todos aquellos materiales que se colocan sobre una superficie de obra negra, para darle terminación a las obras, quedando ésta con un aspecto habitable. Sus componentes son: fachada, cubrimiento de muros y pisos.'),
	 (483,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,2,'Banio',NULL,0,'Baño','Espacio o lugar especialmente equipado para el aseo personal. Sus componentes son: tamaño, enchapes y mobiliario.'),
	 (484,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,3,'Cocina',NULL,0,'Cocina','Espacio o lugar especialmente equipado para la preparación de alimentos. Sus componentes son: tamaño, enchapes y mobiliario.'),
	 (485,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseCalificacionTipo',NULL,4,'Complemento_Industria',NULL,0,'Complemento industria','Elemento adicional para la calificación de las Cerchas para las construcciones industriales.');INSERT INTO test_ladm_col_queries.lc_clasesuelotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (286,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseSueloTipo',NULL,0,'Urbano',NULL,0,'Urbano','Constituyen el suelo urbano, las áreas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energía, acueducto y alcantarillado, posibilitándose su urbanización y edificación, según sea el caso. Podrán pertenecer a esta categoría aquellas zonas con procesos de urbanización incompletos, comprendidos en áreas consolidadas con edificación, que se definan como áreas de mejoramiento integral en los planes de ordenamiento territorial.

Las áreas que conforman el suelo urbano serán delimitadas por perímetros y podrán incluir los centros poblados de los corregimientos. En ningún caso el perímetro urbano podrá ser mayor que el denominado perímetro de servicios públicos o sanitario. (Artículo 31, Ley 388 de 1997)'),
	 (287,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseSueloTipo',NULL,1,'Rural',NULL,0,'Rural','Constituyen esta categoría los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinación a usos agrícolas, ganaderos, forestales, de explotación de recursos naturales y actividades análogas. (Artículo 33, Ley 388 de 1997)'),
	 (288,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ClaseSueloTipo',NULL,2,'Expansion_Urbana',NULL,0,'Expansión urbana','Constituido por la porción del territorio municipal destinada a la expansión urbana, que se habilitará para el uso urbano durante la vigencia del plan de ordenamiento, según lo determinen los Programas de Ejecución.

La determinación de este suelo se ajustará a las previsiones de crecimiento de la ciudad y a la posibilidad de dotación con infraestructura para el sistema vial, de transporte, de servicios públicos domiciliarios, áreas libres, y parques y equipamiento colectivo de interés público o social.

Dentro de la categoría de suelo de expansión podrán incluirse áreas de desarrollo concertado, a través de procesos que definan la conveniencia y las condiciones para su desarrollo mediante su adecuación y habilitación urbanística a cargo de sus propietarios, pero cuyo desarrollo estará condicionado a la adecuación previa de las áreas programadas. (Artículo 32, Ley 388 de 1997)');INSERT INTO test_ladm_col_queries.lc_condicionprediotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
