	 (299,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,1,'PH.Matriz',NULL,0,'(Propiedad horizontal) Matriz','Predio matriz del régimen de propiedad horizontal sobre el cual se segregan todas las unidades prediales.'),
	 (300,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,2,'PH.Unidad_Predial',NULL,0,'(Propiedad horizontal) Unidad Predial','Apartamento, garaje, depósito o cualquier otro tipo de unidad predial dentro del PH que se encuentra debidamente inscrito en el registro de instrumentos públicos'),
	 (301,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,3,'Condominio.Matriz',NULL,0,'(Condominio) Matriz','Predio matriz del condominio sobre el cual se segregan todas las unidades prediales.'),
	 (302,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,4,'Condominio.Unidad_Predial',NULL,0,'(Condominio) Unidad predial','Unidad predial dentro del condominio matriz.'),
	 (303,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,5,'Mejora.PH',NULL,0,'(Mejora) Propiedad horizontal','Mejora sobre un predio sometido a régimen de propiedad horizontal'),
	 (304,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,6,'Mejora.NPH',NULL,0,'(Mejora) No propiedad horizontal','Mejora sobre un predio no sometido a régimen de propiedad horizontal.'),
	 (305,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,7,'Parque_Cementerio.Matriz',NULL,0,'(Parque cementerio) Matriz','Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.'),
	 (306,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,8,'Parque_Cementerio.Unidad_Predial',NULL,0,'(Parque Cementerio) Unidad predial','Área o sección de terreno con función de tumba, esta debe encontrarse inscrita en el registro de instrumentos públicos.'),
	 (307,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_CondicionPredioTipo',NULL,9,'Via',NULL,0,'Vía','Espacio (terreno y construcción) diseñado y destinado para el tránsito de vehículos, personas, entre otros');
