	 (114,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial.Tipo_Novedad',NULL,1,'Desenglobe',NULL,0,'Desenglobe',NULL),
	 (115,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial.Tipo_Novedad',NULL,2,'Englobe',NULL,0,'Englobe',NULL),
	 (116,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial.Tipo_Novedad',NULL,3,'Cancelacion',NULL,0,'Cancelación',NULL),
	 (117,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial.Tipo_Novedad',NULL,4,'Cambio_Numero_Predial',NULL,0,'Cambio de número predial',NULL),
	 (118,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial.Tipo_Novedad',NULL,5,'Ninguna',NULL,0,'Ninguna',NULL);INSERT INTO test_ladm_col_queries.lc_fotoidentificaciontipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (496,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_FotoidentificacionTipo',NULL,0,'Visible',NULL,0,'Visible','Demarcación de un área con un punto que se encuentra visible en un proceso de fotoidentificación.'),
