	 (723,'556DA94A-9C8B-47CA-8D97-02CBB27C90BE','FUENTEESPACIAL',127,'FUENTEESPACIAL',NULL,297,180,NULL,'FUENTEESPACIAL','2');INSERT INTO test_ladm_col_queries.lc_grupoetnicotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (289,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo',NULL,0,'Indigena',NULL,0,'Indígena','Son el grupo humano que vive de acuerdo con las formas de relación con el medio natural en el que se asentaron los diferentes grupos aborígenes desde antes de la conquista y la han conservado y dinamizado a lo largo de la historia.'),
	 (290,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo',NULL,1,'Rrom',NULL,0,'Rrom','El pueblo Rrom o gitano se consolida y fortalece como grupo étnico que hacer parte de la diversidad étnica y cultural de la nación colombiana. Su origen se remonta a más de 1000 años, proviene del norte de la India y conserva un alto bagaje cultural que lo diferencia de otros pueblos y de la sociedad mayoritaria. En este sentido, cuenta con unos elementos identitarios que los diferencian notablemente de los demás grupos étnicos de la sociedad. Sé es Rrom o gitano por derecho de nacimiento y se lleva la sangre gitana.'),
	 (291,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo',NULL,2,'Raizal',NULL,0,'Raizal','Es la población nativa de las Islas de San Andrés, Providencia Y Santa Catalina descendientes de la unión entre europeos (principalmente ingleses, españoles y holandeses) y esclavos africanos. Se distinguen por su cultura, lengua (creole), creencias religiosas (iglesia bautista) y pasado histórico similar a los pueblos antillanos como Jamaica y Haití.'),
	 (292,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo',NULL,3,'Palenquero',NULL,0,'Palenquero','La comunidad palenquera está conformada por los descendientes de los esclavizados que mediante actos de resistencia y de libertad, se refugiaron en los territorios de la Costa Norte de Colombia desde el Siglo XV denominados palenques. Existen 4 Palenques reconocidos: San Basilio de Palenque (Mahates – Bolívar), San José de Uré (Córdoba), Jacobo Pérez escobar (Magdalena) y La Libertad (Sucre).'),
	 (293,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo',NULL,4,'Negro_Afrocolombiano',NULL,0,'Negro o afrocolombiano','Es el conjunto de familias de ascendencia afrocolombiana que poseen una cultura propia, comparten una historia y tienen sus propias tradiciones y costumbres dentro de la relación campo-poblado, además revelan y conservan conciencia de identidad que las distinguen de otros grupos étnicos. Se suele denominar a este grupo humano como negros, morenos, mulatos y afrodescendientes.'),
	 (294,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_GrupoEtnicoTipo',NULL,5,'Ninguno',NULL,0,'Ninguno','No pertenece a ningún grupo étnico.');INSERT INTO test_ladm_col_queries.lc_interesado (T_Id,T_Ili_Tid,tipo,tipo_documento,documento_identidad,primer_nombre,segundo_nombre,primer_apellido,segundo_apellido,sexo,grupo_etnico,razon_social,nombre,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
