	 (764,'EE514D6C-E223-4AE9-AF21-774CFA4F880A','1_telefono1','1_telefono2','1_domicilio_notificacion',NULL,'1_correo_electronico',NULL,'11','11',NULL,NULL,747);INSERT INTO test_ladm_col_queries.lc_interesadodocumentotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (354,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,0,'Cedula_Ciudadania',NULL,0,'Cédula de ciudadanía','Es un documento emitido por la Registraduría Nacional del Estado Civil para permitir la identificación personal de los ciudadanos.'),
	 (355,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,1,'Cedula_Extranjeria',NULL,0,'Cédula de extranjería','Es el documento que cumple los fines de identificación de los extranjeros en el territorio nacional y su utilización deberá estar acorde con la visa otorgada al extranjero.'),
	 (356,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,2,'NIT',NULL,0,'NIT','El Número de Identificación Tributaria (NIT) es un código privado, secreto e intransferible que solamente debe conocer el contribuyente.'),
	 (357,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,3,'Tarjeta_Identidad',NULL,0,'Tarjeta de identidad','Es el documento oficial que hace las veces de identificación para los menores de edad entre los 7 y los 18 años.'),
	 (358,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,4,'Registro_Civil',NULL,0,'Registro civil','Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y demás hechos relativos al estado civil de las personas. En el modelo se tendrá en cuenta el número de registro como identificación personal de las personas de 0 a 7 años.'),
	 (359,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoDocumentoTipo',NULL,5,'Secuencial',NULL,0,'Secuencial','Es un consecutivo asignado automáticamente en registro en lugar del número de la identificación de la persona que hace el trámite, se usa especialmente en trámites de construcción cuando el proyecto está a nombre de una Fiducia el cual tiene el mismo número del banco.');INSERT INTO test_ladm_col_queries.lc_interesadotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (489,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoTipo',NULL,0,'Persona_Natural',NULL,0,'Persona natural','Se refiere a la persona humana.'),
	 (490,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_InteresadoTipo',NULL,1,'Persona_Juridica',NULL,0,'Persona jurídica','Se llama persona jurídica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurídicas son de dos especies: corporaciones y fundaciones de beneficencia pública.');INSERT INTO test_ladm_col_queries.lc_lindero (T_Id,T_Ili_Tid,longitud,geometria,localizacion_textual,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
