	 (205,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,13,'Cubierta.Eternit_O_Teja_De_Barro_Cubierta_Sencilla',NULL,0,'(Cubierta) Eternit o teja de barro (cubierta sencilla)',NULL),
	 (206,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,14,'Cubierta.Azotea_Aluminio_Placa_Sencilla_Con_Eternit',NULL,0,'(Cubierta) Azotea, aluminio, placa sencilla con eternit o teja de barro',NULL),
	 (207,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,15,'Cubierta.Placa_Impermeabilizada_Cubierta_Lujosa_U_Ornamental',NULL,0,'(Cubierta) Placa imperbeabilizada cubierta lujosa u ornamental',NULL),
	 (208,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,16,'Fachada.Pobre',NULL,0,'(Fachada) Pobre','-Puerta:  Fabricada con materiales como: Maderas burdas, lámina de zinc, lata o latones carecen por completo de lujos.

-Ventanas:  En la gran mayoría de casos son pequeñas, en madera burda o ángulo de hierro sencillo.

-Cubrimiento del muro:  Generalmente los muros no tienen cubrimiento, se presentan con ladrillo corrientes o bloque a la vista y en algunos casos pintura de cal o carburo directamente sobre el ladrillo, y en ocasiones pañete sin pintar o con pinturas muy económicas.'),
	 (209,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,17,'Fachada.Sencilla',NULL,0,'(Fachada) Sencilla','-Puerta:  En maderas sin trabajar o láminas metálicas sin ornamentación

-Ventanas:  Pequeñas o de regular tamaño, en madera sin trabajo ornamental o metal con pintura de aceite.

-Cubrimiento de muros:  En la mayoría de los casos se encuentran pañetes con pinturas económicas, o ladrillo prensado a la vista, generalmente un solo plano en el frente.'),
	 (210,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,18,'Fachada.Regular',NULL,0,'(Fachada) Regular','-Puerta de distintos tamaños, construidas en madera elaborada, o metal en lámina doblada, con rejas en ornamentación metálica en la mayoría de los casos.

-Cubrimiento:  Se encuentran frecuentemente pañetados y enlucidos con pintura de regular calidad; en urbanizaciones se utiliza bastante el pañete rústico pintado con cal o carburo.  Otras opciones son: En ladrillo prensado a la vista, el granito y la chapa de piedra de presentación sencilla.  Hasta dos planos enfrente y con una longitud entre 7 y 8 mts, con antejardín, donde la puerta de garaje forma parte integral de esta fachada.'),
	 (211,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ObjetoConstruccionTipo',NULL,19,'Fachada.Buena',NULL,0,'(Fachada) Buena','-Puertas en maderas con cierto trabajo manual; en algunos casos en lámina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.

-Ventanas:  Amplias, en lámina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.

-Cubrimiento:  Pañete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rústico fino pintado en vinilo, piedra pulida.

-La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.');
