	 (1019,'6DDEDA55-CBB6-4C28-B87B-E1A9637EDF98','25','394','123',0,NULL,NULL,'253940000000000230241000000999',NULL,'0057',NULL,332,298,'Apartamento 101','2019-02-27 01:28:25.0',NULL,'LC_PREDIO','51');INSERT INTO test_ladm_col_queries.lc_procedimientocatastralregistraltipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (579,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo',NULL,0,'Actualizacion_Linderos',NULL,0,'Actualización linderos con efectos registrales','El gestor catastral competente, de oficio o a solicitud de parte del titular del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, podrán efectuar la actualización mediante la descripción técnica de linderos de bienes inmuebles, cuando sean verificables mediante métodos directos y/o indirectos sin variación, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. La descripción de los linderos llevará a la certeza del área. Articulo 2.2.2.2.17. Decreto 148 de 2020.'),
	 (580,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo',NULL,1,'Rectificacion_Area',NULL,0,'Rectificación de área por imprecisa determinación con efectos registrales','La rectificación de área en el sistema catastral y/o registral procederá ante el gestor catastral, de oficio o a solicitud de parte del titular  del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, cuando los linderos estén debida y técnicamente descritos, sean verificables mediante métodos directos y/o indirectos sin variación, pero que a lo largo de la tradición del bien inmueble el área de éste no haya sido determinada adecuadamente, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. Artículo 2.2.2.2.17. Decreto 148 de 2020.'),
	 (581,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo',NULL,2,'Rectificacion_Linderos',NULL,0,'Rectificación de linderos por acuerdo entre las partes con efectos registrales','La rectificación de linderos en el sistema catastral y registral procederá de oficio o a solicitud de parte, ante el gestor catastral, siempre y cuando se haya suscrito acta de colindancia con pleno acuerdo entre los propietarios que compartan uno o varios linderos, pero se adviertan diferencias de linderos y áreas, entre la verificación mediante métodos directos y/o indirectos y la información del folio de matricula inmobiliaria. La rectificación de todos los linderos puede llevar a la certeza del área del inmueble. Artículo 2.2.2.2.17. Decreto 148 de 2020.'),
	 (582,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo',NULL,3,'Inclusion_Cabida_Linderos',NULL,0,'Inclusión en el campo de cabida y linderos del dato del área y/o linderos en los folios de matrícula inmobiliaria','n los casos donde los folios de matrícula inmobiliaria no hayan contado con información de área y/o linderos, desde el inicio del ciclo traslaticio del bien
inmueble que identifican; la Oficina de Registro de Instrumentos Públicos procederá la inclusión del dato de área y/o linderos en las respectivas matrículas inmobiliarias, que se tomará de la base catastral administrada por el gestor catastral competente.'),
	 (583,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ProcedimientoCatastralRegistralTipo',NULL,4,'No_Requiere',NULL,0,'No requiere procedimiento','No requiere procedimiento catastral con efecto registral.');INSERT INTO test_ladm_col_queries.lc_puntocontroltipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (498,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PuntoControlTipo',NULL,0,'Control',NULL,0,'Control','Puntos en el terreno levantados por topografía o geodesia que sirven de base para la orientación absoluta en la restitución fotogramétrica, y para efectuar un tratamiento geométrico o geo-referenciación de los datos en teledetección.'),
	 (499,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_PuntoControlTipo',NULL,1,'Apoyo',NULL,0,'Apoyo','Puntos en el terreno levantados por topografía o geodesia que sirven de base para la orientación absoluta en la restitución fotogramétrica, y para efectuar un tratamiento geométrico o geo-referenciación de los datos en teledetección.');INSERT INTO test_ladm_col_queries.lc_puntolevantamiento (T_Id,T_Ili_Tid,id_punto_levantamiento,puntotipo,tipo_punto_levantamiento,fotoidentificacion,exactitud_horizontal,exactitud_vertical,posicion_interpolacion,metodoproduccion,geometria,ue_lc_unidadconstruccion,ue_lc_construccion,ue_lc_terreno,ue_lc_servidumbretransito,ue_lc_nu_espaciojuridicounidadedificacion,ue_lc_nu_espaciojuridicoredservicios,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
