	 (1,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_RelacionPredioTipo',NULL,0,'Parte_Interesada',NULL,0,'Parte interesada (Propietario, Poseedor, Ocupante)','Parte interesada (Propietario, Poseedor, Ocupante)'),
	 (2,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_RelacionPredioTipo',NULL,1,'Vecino',NULL,0,'Vecino','Indica si un vecino de la parte interesada (propietario, poseedor u ocupante) fue el encargado de atender la visita predial.'),
	 (3,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_RelacionPredioTipo',NULL,2,'Familiar',NULL,0,'Familiar','Indica si un familiar de la parte interesada (propietario, poseedor u ocupante) fue el encargado de atender la visita predial.'),
	 (4,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_RelacionPredioTipo',NULL,3,'Arrendatario',NULL,0,'Arrendatario','Indica si el arrendatario o alguna persona de su núcleo familiar fue el encargado de atender la visita predial.'),
	 (5,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_RelacionPredioTipo',NULL,4,'Administrador',NULL,0,'Administrador','Indica si el administrador o alguna persona de su núcleo familiar fue el encargado de atender la visita predial.');INSERT INTO test_ladm_col_queries.lc_restriccion (T_Id,T_Ili_Tid,tipo,descripcion,interesado_lc_interesado,interesado_lc_agrupacioninteresados,unidad,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
