	 (149,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ResultadoVisitaTipo',NULL,3,'No_permitieron_acceso',NULL,0,'No permitieron acceso','No permitieron acceso al predio.'),
	 (150,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ResultadoVisitaTipo',NULL,4,'Menor_de_Edad',NULL,0,'Menor de Edad','No hay adulto en el momento de la visita.'),
	 (151,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ResultadoVisitaTipo',NULL,5,'Situacion_de_Orden_Publico',NULL,0,'Situación de Orden Público','Por temas de seguridad asociados a orden público no es posible el acceso.'),
	 (152,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ResultadoVisitaTipo',NULL,6,'Zona_de_dificil_acceso',NULL,0,'Zona de difícil acceso','Por limitaciones relacionadas con la topografía o accidentes geográficos no hubo acceso al predio.'),
	 (153,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ResultadoVisitaTipo',NULL,7,'Otro',NULL,0,'Otro','Otros casos no relacionados anteriormente.');INSERT INTO test_ladm_col_queries.lc_servidumbretransito (T_Id,T_Ili_Tid,area_servidumbre,dimension,etiqueta,relacion_superficie,geometria,nivel,comienzo_vida_util_version,fin_vida_util_version,espacio_de_nombres,local_id) VALUES
