	 (505,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UnidadConstruccionTipo',NULL,0,'Residencial',NULL,0,'Residencial','Tipo de unidad de construcción en uso para vivienda.'),
