	 (507,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UnidadConstruccionTipo',NULL,2,'Industrial',NULL,0,'Industrial','Tipo de unidad de construcción en uso de actividades industriales.'),
	 (508,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UnidadConstruccionTipo',NULL,3,'Institucional',NULL,0,'Institucional','Tipo de unidad de construcción en uso de actividades institucionales.'),
	 (509,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UnidadConstruccionTipo',NULL,4,'Anexo',NULL,0,'Anexo','Tipo de unidad de construcción anexa, por ejemplo, piscinas, cobertizos, canchas de tenis, toboganes.');INSERT INTO test_ladm_col_queries.lc_usouconstipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (9,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,0,'Residencial.Apartamentos_4_y_mas_pisos_en_PH',NULL,0,'(Residencial) Apartamentos 4 y más pisos en PH','Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos sometido en régimen de propiedad horizontal.'),
	 (10,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,1,'Residencial.Apartamentos_En_Edificio_4_y_5_Pisos_Cartagena',NULL,0,'(Residencial) Apartamentos en Edificio de 4 y 5 Pisos (Cartagena)','Es una vivienda que comprende una o más habitaciones, en un edificio de 4 o 5 pisos.'),
	 (11,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,2,'Residencial.Apartamentos_Mas_De_4_Pisos',NULL,0,'(Residencial) Apartamentos mas de 4 Pisos','Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos'),
	 (12,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,3,'Residencial.Barracas',NULL,0,'(Residencial) Barracas','Dormitorios de las fuerzas armadas y militares'),
	 (13,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,4,'Residencial.Casa_Elbas',NULL,0,'(Residencial) Casa Elbas','Típica casa con mampostería de piedra, pizarra y madera. Ha sido rehabilitada respetando escrupulosamente sus características exteriores y decorada con un interior tradicional'),
	 (14,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,5,'Residencial.Depositos_Lockers',NULL,0,'(Residencial) Depósitos o lockers','Edificación destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los sótanos y semisótanos de los edificios, junto a los parqueaderos. Las áreas de estos depósitos generalmente no supera los 25 metros cuadrados.'),
	 (15,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,6,'Residencial.Garajes_Cubiertos',NULL,0,'(Residencial) Garajes Cubiertos','Es el lugar cubierto, destinado al estacionamiento privado de vehículos.'),
	 (16,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,7,'Residencial.Garajes_En_PH',NULL,0,'(Residencial) Garajes en PH','Es el lugar cubierto, destinado al estacionamiento privado o comunal en viviendas sometidas a régimen de propiedad  horizontal.'),
	 (17,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,8,'Residencial.Salon_Comunal',NULL,0,'(Residencial) Salón comunal','Los salones comunales son dependencias que se construyen dentro de los edificios y conjuntos que sobrepasan un área determinada de construcción, y se clasifican de acuerdo a las normas urbanísticas como equipamiento comunal privado.'),
	 (18,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,9,'Residencial.Secadero_Ropa',NULL,0,'(Residencial) Secadero de ropa','Bien inmueble cubierto o descubierto ubicado en el último piso de algunos edificios utilizado para extender y secar la ropa y que está sometido a régimen de propiedad horizontal.');
INSERT INTO test_ladm_col_queries.lc_usouconstipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (19,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,10,'Residencial.Vivienda_Colonial',NULL,0,'(Residencial) Vivienda Colonial','Son las viviendas construidas durante el tiempo de la colonia española, se caracterizan por tener varias habitaciones, con ventanales que dan a uno o dos patios generalmente ubicados en el centro de la vivienda. Los principales materiales de la época era la tapia, bahareque, ladrillo, paja y teja.'),
	 (20,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,11,'Residencial.Vivienda_Hasta_3_Pisos',NULL,0,'(Residencial) Vivienda hasta 3 pisos','Es una casa de tres niveles cuya función arquitectónica y ambiental principal, es dar albergue en forma adecuada a una familia.'),
	 (21,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,12,'Residencial.Vivienda_Hasta_3_Pisos_En_PH',NULL,0,'(Residencial) Vivienda hasta 3 pisos en PH','Corresponde a edificaciones residenciales desarrolladas sobre un lote de terreno que comprende más de tres unidades prediales independientes, generalmente en edificios de varios pisos. Este tipo de vivienda prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal'),
	 (22,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,13,'Residencial.Vivienda_Recreacional',NULL,0,'(Residencial) Vivienda Recreacional','Es una vivienda acondicionada para la realización de actividades recreativas libres y el descanso.'),
	 (23,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,14,'Residencial.Vivienda_Recreacional_En_PH',NULL,0,'(Residencial) Vivienda Recreacional en PH','Es una casa cuya función arquitectónica y ambiental principal, es brindar descanso y recreación. Este tipo de vivienda  prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal.'),
	 (24,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,15,'Comercial.Bodegas_Comerciales_Grandes_Almacenes',NULL,0,'(Comercial) Bodegas Comerciales - Grandes Almacenes','Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno'),
	 (25,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,16,'Comercial.Bodegas_Comerciales_en_PH',NULL,0,'(Comercial) Bodegas Comerciales en PH','Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno sometido a régimen de propiedad horizontal.'),
	 (26,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,17,'Comercial.Centros_Comerciales',NULL,0,'(Comercial) Centros Comerciales','es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto.'),
	 (27,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,18,'Comercial.Centros_Comerciales_en_PH',NULL,0,'(Comercial) Centros Comerciales en PH','Es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto, sometido a régimen de propiedad horizontal.'),
	 (28,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,19,'Comercial.Clubes_Casinos',NULL,0,'(Comercial) Clubes - Casinos','Es la edificación o  Establecimiento que brinda servicios recreativos y tiene capacidad para ciertos juegos de azar');
INSERT INTO test_ladm_col_queries.lc_usouconstipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (29,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,20,'Comercial.Comercio',NULL,0,'(Comercial) Comercio','Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes'),
	 (30,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,21,'Comercial.Comercio_Colonial',NULL,0,'(Comercial) Comercio Colonial','Se denomina a la construcción con características arquitectónicas coloniales,  en el cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes'),
	 (31,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,22,'Comercial.Comercio_en_PH',NULL,0,'(Comercial) Comercio en PH','Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes sometida a régimen de propiedad horizontal'),
	 (32,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,23,'Comercial.Hotel_Colonial',NULL,0,'(Comercial) Hotel Colonial','Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento y posee características arquitectónicas coloniales.'),
