	 (101,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,92,'Anexo.Pozos',NULL,0,'(Anexo) Pozos','Perforaciones profundas  manuales para extraer agua subterránea.  Medida en metros de profundidad.'),
	 (102,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,93,'Anexo.Ramadas_Cobertizos_Caneyes',NULL,0,'(Anexo) Ramadas - Cobertizos - Caneyes','Consiste en un sitio cubierto elaborado con el fin de resguardar de la intemperie; el nombre de enramadas, cobertizos o caney se utiliza según la forma de la cubierta y la región donde se ubique.'),
	 (103,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,94,'Anexo.Secaderos',NULL,0,'(Anexo) Secaderos','Construcciones elaboradas con el objeto de secar en condiciones naturales el café principalmente, aunque es común su uso en otros productos.  Consta de estructura y pisos para su calificación'),
	 (104,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,95,'Anexo.Silos',NULL,0,'(Anexo) Silos','Construcción de grandes dimensiones que sirve para almacén o depósito, se exceptúan los silos cafeteros'),
	 (105,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,96,'Anexo.Tanques',NULL,0,'(Anexo) Tanques','Depósitos subterráneos o de altura, construidos en zonas con deficiencias en abastecimiento para el consumo de los habitantes o para el uso agrícola.  El elemento a calificar es la estructura relacionada con la capacidad de almacenamiento medida en metros cúbicos.

Se excluyen de este tipo de construcción los tanques de almacenamiento domiciliario'),
	 (106,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,97,'Anexo.Toboganes',NULL,0,'(Anexo) Toboganes','Deslizadores construidos alrededor de piscinas, medidos en metros lineales.  Se clasifican según su altura y materiales de construcción'),
	 (107,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,98,'Anexo.Torre_de_Control',NULL,0,'(Anexo) Torre de control','Edificio en forma de torre, en cuya cima se sitúa una sala de control, desde la que se dirige y controla el tráfico de un puerto, de un aeropuerto o de un circuito de carreras.'),
	 (108,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,99,'Anexo.Torres_de_Enfriamiento',NULL,0,'(Anexo) Torres de Enfriamiento','Son estructuras diseñadas para disminuir la temperatura del agua y otros medios.');
INSERT INTO test_ladm_col_queries.lc_usouconstipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (109,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,100,'Anexo.Unidad_Predial_por_Construir',NULL,0,'(Anexo) Unidad predial por construir','Se le asigna a las unidades prediales no edificadas o por construir'),
	 (110,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_UsoUConsTipo',NULL,101,'Anexo.Via_Ferrea',NULL,0,'(Anexo) Vía Férrea','Parte de la infraestructura ferroviaria que une dos puntos determinados del territorio');INSERT INTO test_ladm_col_queries.lc_viatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (158,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,0,'Arteria',NULL,0,'Arteria','Vía de un sistema vial urbano con prelación de circulación de tránsito sobre las demás vías, con excepción de la vía férrea y la autopista'),
	 (159,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,1,'Autopista',NULL,0,'Autopista','vía de calzadas separadas, cada una con dos (2) o más carriles, control total de acceso y salida, con intersecciones en desnivel o mediante entradas y salidas directas a otras carreteras y con control de velocidades mínimas y máximas por carril.'),
	 (160,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,2,'Carreteable',NULL,0,'Carreteable','Vía cuya finalidad es permitir la circulación de vehículos, con niveles adecuados de seguridad y comodidad.'),
	 (161,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,3,'Cicloruta',NULL,0,'Ciclorruta','vía o sección de la calzada destinada al tránsito de bicicletas en forma exclusiva.'),
	 (162,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,4,'Colectora',NULL,0,'Colectora','Tramo de carretera que se introduce paralelamente a la carretera principal en la zona de un enlace o entre enlaces consecutivos.'),
	 (163,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,5,'Departamental',NULL,0,'Departamental','Son aquellas a cargo de los departamentos'),
	 (164,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,6,'Ferrea',NULL,0,'Férrea','Diseñada para el transito de vehículos sobre rieles, con prelación sobre las demás vías, excepto para las ciudades donde existe metro, en cuyos casos será este el que tenga prelación.'),
	 (165,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,7,'Local',NULL,0,'Local','Conforman el sistema vial urbano menor y se conectan solamente con las vías colectoras'),
	 (166,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,8,'Metro_o_Metrovia',NULL,0,'Metro o metrovía','Es aquella de exclusiva destinación para las líneas de metro, independientemente de su configuración y que hacen parte integral de su infraestructura de operación.'),
	 (167,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,9,'Nacional',NULL,0,'Nacional','Aquellas vías cuyo mantenimiento corresponde al gobierno nacional.');
INSERT INTO test_ladm_col_queries.lc_viatipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (168,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,10,'Ordinaria',NULL,0,'Ordinaria','La que tiene tránsito subordinado a las vías principales.'),
	 (169,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,11,'Peatonal',NULL,0,'Peatonal','Zonas destinadas para el transito exclusivo de peatones.'),
	 (170,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,12,'Principal',NULL,0,'Principal','Son aquellas troncales, transversales y accesos a capitales de Departamento que cumplen la función básica de integración de las principales zonas de producción y consumo del país y de éste con los demás países.'),
	 (171,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,13,'Privada',NULL,0,'Privada','Via que está destinada al uso particular.'),
	 (172,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,14,'Secundaria',NULL,0,'Secundaria','Son aquellas vías que unen las cabeceras municipales entre sí y/o que provienen de una cabecera municipal y conectan con una carretera Primaria.'),
	 (173,'Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_1.LC_ViaTipo',NULL,15,'Troncal',NULL,0,'Troncal','Vía de dos (2) calzadas con ocho o más carriles y con destinación exclusiva de las calzadas interiores para el tránsito de servicio público masivo.');INSERT INTO test_ladm_col_queries.snr_calidadderechotipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
