	 (500,'Submodelo_Insumos_SNR_V1_0.SNR_ClasePredioRegistroTipo',NULL,0,'Rural',NULL,0,'Rural','Constituyen esta categoría los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinación a usos agrícolas, ganaderos, forestales, de explotación de recursos naturales y actividades análogas. (Artículo 33, Ley 388 de 1997)'),
	 (501,'Submodelo_Insumos_SNR_V1_0.SNR_ClasePredioRegistroTipo',NULL,1,'Urbano',NULL,0,'Urbano','Constituyen el suelo urbano, las áreas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energía, acueducto y alcantarillado, posibilitándose su urbanización y edificación, según sea el caso. Podrán pertenecer a esta categoría aquellas zonas con procesos de urbanización incompletos, comprendidos en áreas consolidadas con edificación, que se definan como áreas de mejoramiento integral en los planes de ordenamiento territorial.

Las áreas que conforman el suelo urbano serán delimitadas por perímetros y podrán incluir los centros poblados de los corregimientos. En ningún caso el perímetro urbano podrá ser mayor que el denominado perímetro de servicios públicos o sanitario. (Artículo 31, Ley 388 de 1997)'),
	 (502,'Submodelo_Insumos_SNR_V1_0.SNR_ClasePredioRegistroTipo',NULL,2,'Sin_Informacion',NULL,0,'Sin información',NULL);INSERT INTO test_ladm_col_queries.snr_documentotitulartipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (134,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,0,'Cedula_Ciudadania',NULL,0,'Cédula de ciudadanía','Es un documento emitido por la Registraduría Nacional del Estado Civil para permitir la identificación personal de los ciudadanos.'),
	 (135,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,1,'Cedula_Extranjeria',NULL,0,'Cédula de extranjería','Es el documento que cumple los fines de identificación de los extranjeros en el territorio nacional y su utilización deberá estar acorde con la visa otorgada al extranjero.'),
	 (136,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,2,'NIT',NULL,0,'NIT','El Número de Identificación Tributaria (NIT) es un código privado, secreto e intransferible que solamente debe conocer el contribuyente.'),
	 (137,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,3,'Tarjeta_Identidad',NULL,0,'Tarjeta de identidad','Es el documento oficial que hace las veces de identificación para los menores de edad entre los 7 y los 18 años.'),
	 (138,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,4,'Registro_Civil',NULL,0,'Registro civil','Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y demás hechos relativos al estado civil de las personas. En el modelo se tendrá en cuenta el número de registro como identificación personal de las personas de 0 a 7 años.'),
	 (139,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,5,'NUIP',NULL,0,'NUIP','El Número Único de Identificación Personal, es el número que permite identificar a los colombianos durante toda su vida.'),
	 (140,'Submodelo_Insumos_SNR_V1_0.SNR_DocumentoTitularTipo',NULL,6,'Secuencial_SNR',NULL,0,'Secuencial SNR','Es un consecutivo asignado automáticamente en registro en lugar del número de la identificación de la persona que hace el trámite, se usa especialmente en trámites de construcción cuando el proyecto está a nombre de una Fiducia el cual tiene el mismo número del banco.');INSERT INTO test_ladm_col_queries.snr_fuentetipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (141,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,0,'Acto_Administrativo',NULL,0,'Acto administrativo','Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.'),
	 (142,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,1,'Escritura_Publica',NULL,0,'Escritura pública','Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó'),
	 (143,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,2,'Sentencia_Judicial',NULL,0,'Sentencia judicial','La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo'),
	 (144,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,3,'Documento_Privado',NULL,0,'Documento privado','Documento que contiene un compromiso entre dos o más personas que lo firman.'),
	 (145,'Submodelo_Insumos_SNR_V1_0.SNR_FuenteTipo',NULL,4,'Sin_Documento',NULL,0,'Sin documento','Cuando no se haya documento soporte pero puede ser una declaración verbal.');INSERT INTO test_ladm_col_queries.snr_personatitulartipo (T_Id,thisClass,baseClass,itfCode,iliCode,seq,inactive,dispName,description) VALUES
	 (326,'Submodelo_Insumos_SNR_V1_0.SNR_PersonaTitularTipo',NULL,0,'Persona_Natural',NULL,0,'Persona natural','Se refiere a la persona humana.'),
	 (327,'Submodelo_Insumos_SNR_V1_0.SNR_PersonaTitularTipo',NULL,1,'Persona_Juridica',NULL,0,'Persona jurídica','Se llama persona jurídica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurídicas son de dos especies: corporaciones y fundaciones de beneficencia pública.');INSERT INTO test_ladm_col_queries.T_ILI2DB_ATTRNAME (IliName,SqlName,ColOwner,Target) VALUES
